import {Button} from "reactstrap";

import {Modal, ModalHeader, ModalBody, ModalFooter, FormGroup, Input, Label} from "reactstrap";


const TestButton = (props) => {

    const [show, setShow] = React.useState(false);

    const showDetails = () => {
        setShow(true);
    };
    
    const hideDetails = (e) => {
        e.stopPropagation();
        setShow(false);
    };
    

    return(
        <>
        <div className="principal">

            <div className="secundario">

                <Button variant="primary" onClick={activar}> Primary</Button>

            </div> 
        </div>

        <Modal show={hideDetails}>
            <ModalHeader> Iniciar Sesi√≥n </ModalHeader>
                
            <ModalBody> 
                <FormGroup>
                    <Label for = "usuario"> Usuario </Label>
                    <Input type = "text" id="usuario"/>
                </FormGroup>

                <FormGroup>
                    <Label for = "pass"> Pass </Label>
                    <Input type = "text" id="pass"/>
                </FormGroup> 

            </ModalBody>

            <ModalFooter> 
                <Button variant="secondary" onClick={desactivar}>
                    Close
                </Button>
            </ModalFooter>

        </Modal>
        </>
    )
}

export default TestButton;
